cy.get("table").then(($table) => {
    if ($table.find("tbody tr").is(":visible")) {
        cy.get("table tbody tr")
            .eq(0)
            .find("td")
            .eq(1)
            .invoke("text")
            .then((tMail) => {
            cy.wrap(tMail.trim()).as("tMail1");
        });
        cy.getInitItemsCountInListView();
        manage_users_1.ManageUsers.clickDeleteOnTheLastUser();
        //  Verify The Components of Cancel Pop up
        // ManageUsers.verifyTheComponentsOfCancelPopup();
        //  Click Cancel Button
        manage_users_1.ManageUsers.cancelTheDeletePopUp();
        //  Verify that No Data is Deleted
        cy.get("@tMail1").then((tMail1) => {
            cy.get("table tbody tr")
                .eq(0)
                .find("td")
                .eq(1)
                .scrollIntoView()
                .invoke("text")
                .then((tMail2) => {
                expect((0, utils_1.trimText)(tMail1.toString().trim())).to.equal((0, utils_1.trimText)(tMail2));
            });
        });
        cy.assertItemDeletedFromListView();
    }
    else {
        cy.log("Table is Empty");
    }
});

cy.get("table").then(($table) => {
    if ($table.find("tbody tr").is(":visible")) {
        cy.get("tbody tr")
            .last()
            .find("td")
            .eq(1)
            .invoke("text")
            .then((tMail) => {
            cy.wrap(tMail.trim()).as("tMail1");
        });
        cy.getInitItemsCountInListView();
        manage_users_1.ManageUsers.clickDeleteOnTheLastUser();
        cy.confirmDeletePopUp();
        //  Verify that No Data is Deleted
        cy.get("@tMail1").then((tMail1) => {
            cy.get("tbody tr")
                .last()
                .find("td")
                .eq(1)
                .scrollIntoView()
                .invoke("text")
                .then((tMail2) => {
                expect((0, utils_1.trimText)(tMail1.toString().trim())).not.to.equal((0, utils_1.trimText)(tMail2));
            });
        });
        cy.assertItemDeletedFromListView();
    }
    else {
        cy.log("Table is Empty");
    }
});
